import logo from './logo.svg';
import './App.css';
import Sidebar from './Home/Sidebar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Homes from './Home/Isi';


function App() {
  return (
    <Router>
      <Sidebar />
      <Routes>
        <Route exact path='/' exact element={<Homes />} />
      </Routes>
    </Router>
  );
}

export default App;
